import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const name='Kanji';
const img1='https://picsum.photos/300/300';
const img2='https://picsum.photos/200/200';
const img3='https://picsum.photos/150/150';
const link='https://google.com';

const head={
    color: 'crimson',
    textAlign: 'center',
    textTransform: 'capitalize',
    fontWeight: 'bold',
    textShadow: '0px 2px 5px green',
    margin: '50px 0'
}

ReactDOM.render(
    <>
    <h1 style={head}>My Name is {name}</h1>
    <p style={{color:'black',textTransform:'uppercase',}}>Dhrabavad</p>

    <div className='img_div'>
    <img src={img1} alt='Random'/>
    <img src={img2} alt='Random'/>
    <a href={link} target='_blank'>
    <img src={img3} alt='Random'/>
    </a>
    </div>

    </>,
    document.getElementById('root')
);
